import React from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import AddTaskIcon from '@mui/icons-material/AddTask';
const InputBar = () => {

    const event = (val) => {
        
      
        if(val==="1")
        {
             document.getElementsByClassName("dis_none").style.display="block";
        }
        else{
        document.getElementsByClassName("dis_none").style.display="none";
        }
        
    }

    return (<>
        <div className="container upperwala">
            <div className=" upperwala2">
                <div  className="dis_none input-group mb-2 ">
                    <input style={{ border: "none" }}  type="text" className="form-control forDisplay w-100" placeholder="Title" aria-label="Recipient's username" aria-describedby="button-addon2" />
                </div>
                <div className="mb-3">
                    <input style={{ border: "none" }} onClick={event("1")}  className="form-control" id="exampleFormControlInput1" placeholder="Take a Note" />
                </div>
                <div className="dis_none mb-3 ">
                    <label  className="form-label d-flex mt-2 "><AddTaskIcon onClick={event("2")}/></label>
                </div>
            </div>
        </div>

    </>)
}
export default InputBar;
